  true,\n\t\"url\": null,\n\t\"notes\": \"Welcome to this first issue of NITRD Leads
  IT, a quarterly newsletter of the Networking and Information Technology Research
  and Development (NITRD) Program. We launched this newsletter to help you keep up
  to date with the most recent and future happenings in NTIRD. We will underline the
  coordination activities of the NITRD Interagency Working Groups (IWGs) and Community
  of Practices (COPs) as well as the NITRD Subcommittee itself. Weu2019ll update you
  on developing and released R&D strategic plans, agenda-defining workshops, and activities
  that engage non-government stakeholders like industry and academics.\",\n\t\"license_title\":
